// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract TokenVestingRetailUnlimited is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event TokensReleased(address token, uint256 amount);

    // 受益人地址
    address public beneficiary;

    // UNIX time，UTC时间戳，单位秒，类型uint，与 block.timestamp 一致
    // 合约开始时间，即锁定开始时间
    uint256 public start;
    // 锁定周期，例如：4年
    uint256 public duration;
    // 总释放比例
    uint256 public totalShares;
    // 质押数量
    uint256 public tokenAmount;

    // 记录每个币种的已释放量
    mapping (address => uint256) private _released;

    // 释放规则参数
    // 每阶段释放时间
    uint256[] private _stageTime = [10 minutes, 20 minutes];
    // 每阶段截断时间单位
    uint256[] private _stageCliffUnit = [5 minutes, 5 minutes];
    // 每阶段释放比例
    uint256[] private _stageRate = [40, 60];

    constructor (address _beneficiary, uint256 _start, uint256 _tokenAmount) {
        require(_beneficiary != address(0), "TokenVestingRetailUnlimited: beneficiary is the zero address");

        beneficiary = _beneficiary;
        start = _start;
        tokenAmount = _tokenAmount;

        for (uint256 i = 0; i < _stageTime.length; i++) {
            duration = duration.add(_stageTime[i]);
            totalShares = totalShares.add(_stageRate[i]);
        }

        // solhint-disable-next-line max-line-length
        require(start.add(duration) > block.timestamp, "TokenVestingRetailUnlimited: final time is before current time");
    }

    /**
     * @return the amount of the token released.
     */
    function released(address token) public view returns (uint256) {
        return _released[token];
    }

    // 提取代币
    function release(IERC20 token) public {
        uint256 unreleased = releasableAmount(token);

        require(unreleased > 0, "TokenVestingRetailUnlimited: no tokens are due");

        _released[address(token)] = _released[address(token)].add(unreleased);

        token.safeTransfer(beneficiary, unreleased);

        emit TokensReleased(address(token), unreleased);
    }

    // 计算可提取代币数量
    function releasableAmount(IERC20 token) public view returns (uint256) {
        return _vestedAmount(token).sub(_released[address(token)]);
    }

    // 计算已释放代币数量
    function _vestedAmount(IERC20 token) private view returns (uint256) {
        uint256 currentBalance = token.balanceOf(address(this));
        uint256 totalBalance = currentBalance.add(_released[address(token)]);

        // 按条件计算已释放代币数量
        if (block.timestamp >= start.add(duration)) {
            return totalBalance;
        } else {
            // 确认是否跳出循环
            bool isJumpFor = false;
            // 记录已释放代币数量
            uint256 vestedAmount = 0;
            // 累计释放时间
            uint256 cumulativeTime = start;
            for (uint256 i = 0; i < _stageTime.length; i++) {
                // 计算每阶段释放次数
                uint256 vestCount = _stageTime[i].div(_stageCliffUnit[i]);
                // 计算每阶段每次的释放比例
                uint256 vestRate = _stageRate[i].div(vestCount);
                for (uint256 j = 0; j < vestCount; j++) {
                    cumulativeTime = cumulativeTime.add(_stageCliffUnit[i]);
                    if (cumulativeTime > block.timestamp) {
                        isJumpFor = true;
                        break;
                    }
                    vestedAmount = vestedAmount.add(totalBalance.mul(vestRate).div(totalShares));
                }
                if (isJumpFor) {
                    break;
                }
            }
            return vestedAmount;
        }
    }
}
